INSERT INTO `policies` VALUES (1, 'chinh sách 5k', '<div>\r\n<p><strong>C&Aacute;CH  1</strong>:<strong> Mua trực tiếp tại c&aacute;c Showroom của Beptot.vn</strong><br />\r\nQu&yacute; kh&aacute;ch c&oacute; thể đến trực tiếp để tham khảo v&agrave; chọn mua c&aacute;c sản phẩm tại c&aacute;c showroom của ch&uacute;ng t&ocirc;i.<br />\r\n<strong>C&Aacute;CH </strong> <strong>2</strong> <strong>: Mua h&agrave;ng online:</strong><br />\r\nKh&aacute;ch h&agrave;ng c&oacute; thể gọi điện thoại đặt h&agrave;ng qua c&aacute;c đầu số Hotline hỗ trợ b&aacute;n h&agrave;ng 24/24h  của ch&uacute;ng t&ocirc;i  tr&ecirc;n website. Ch&uacute;ng t&ocirc;i sẽ xử l&yacute; trong thời gian sớm nhất dựa tr&ecirc;n th&ocirc;ng tin kh&aacute;ch h&agrave;ng cung cấp.<br />\r\n<strong>Để mua h&agrave;ng tr&ecirc;n Website nhanh ch&oacute;ng bạn l&agrave;m theo c&aacute;c bước sau:</strong><br />\r\n- Bạn v&agrave;o Website v&agrave; t&igrave;m c&aacute;c sản phẩm cần mua.<br />\r\n- Nếu bạn muốn t&igrave;m kiếm sản phẩm n&agrave;o đ&oacute; m&agrave; đ&atilde; biết t&ecirc;n hoặc khoảng gi&aacute;, c&oacute; thể sử dụng c&ocirc;ng cụ t&igrave;m kiếm.<br />\r\n<strong>Bước 1: Chọn sản phẩm </strong><br />\r\n- Sau khi chọn được sản phẩm, bạn click v&agrave;o n&uacute;t <strong>th&ecirc;m v&agrave;o giỏ h&agrave;ng / mua h&agrave;ng </strong>tương ứng với sản phẩm cần mua.<br />\r\n<strong>Bước 2: Đặt h&agrave;ng</strong><br />\r\n<br />\r\nBạn h&atilde;y điền đầy đủ v&agrave; ch&iacute;nh x&aacute;c th&ocirc;ng tin để ch&uacute;ng t&ocirc;i c&oacute; thể li&ecirc;n hệ với bạn sớm nhất.<br />\r\n<strong>Bước 3: Ho&agrave;n tất</strong><br />\r\n- Sau khi nhận được đơn h&agrave;ng, nh&acirc;n vi&ecirc;n C&ocirc;ng ty sẽ x&aacute;c thực th&ocirc;ng tin, kiểm tra lại h&agrave;ng v&agrave; li&ecirc;n hệ lại với bạn.<br />\r\n- Kh&aacute;ch h&agrave;ng tiến h&agrave;nh thanh to&aacute;n trực tiếp, chuyển tiền v&agrave;o t&agrave;i khoản của C&ocirc;ng ty, hoặc chuyển tiền qua nh&agrave; xe.<br />\r\n- Sau khi x&aacute;c nhận th&ocirc;ng tin kh&aacute;ch h&agrave;ng v&agrave; nhận được tiền, ch&uacute;ng t&ocirc;i sẽ tiến h&agrave;nh chuyển h&agrave;ng sớm nhất cho qu&yacute; kh&aacute;ch.<br />\r\n<strong>Bước 4: Nhận h&agrave;ng</strong><br />\r\n- Đối với kh&aacute;ch h&agrave;ng ở khu vực nội th&agrave;nh H&agrave; Nội v&agrave; TP.HCM: Nh&acirc;n vi&ecirc;n c&ocirc;ng ty sẽ giao h&agrave;ng tận nh&agrave; cho qu&yacute; kh&aacute;ch.<br />\r\nĐối với c&aacute;c khu vực ở xa hơn ch&uacute;ng t&ocirc;i sẽ gửi h&agrave;ng qua chuyển ph&aacute;t nhanh EMS. Qu&yacute; kh&aacute;ch sẽ nhận được sau 24h đến 48h.<br />\r\n<strong>C&aacute;c phương thức thanh to&aacute;n:</strong><br />\r\n<em>- Với h&agrave;ng giao tận nh&agrave; trong khu vực nội th&agrave;nh H&agrave; Nội v&agrave; TP.HCM</em>: Qu&yacute; kh&aacute;ch thanh to&aacute;n tiền mặt cho nh&acirc;n vi&ecirc;n c&ocirc;ng ty ngay khi nhận được h&agrave;ng.<br />\r\n- <em>Với h&agrave;ng gửi đến nh&agrave; qua dịch vụ chuyển ph&aacute;t nhanh Express:</em> Qu&yacute; kh&aacute;ch vui l&ograve;ng chuyển khoản thanh to&aacute;n tiền mua h&agrave;ng v&agrave; ph&iacute; vận chuyển cho cửa h&agrave;ng trước. Sau khi nhận được tiền, cửa h&agrave;ng sẽ tiến h&agrave;nh gửi h&agrave;ng cho qu&yacute; kh&aacute;ch.<br />\r\nTrong một số trường hợp kh&aacute;ch c&oacute; thể tự thanh to&aacute;n cước vận chuyển trực tiếp cho nh&acirc;n vi&ecirc;n giao nhận.<br />\r\nPh&iacute; vận chuyển sẽ được t&iacute;nh theo Bảng gi&aacute; chuẩn của C&ocirc;ng ty chuyển ph&aacute;t nhanh T&iacute;n Th&agrave;nh.<br />\r\nH&agrave;ng chỉ được gửi đi sau khi Cửa h&agrave;ng đ&atilde; kiểm tra được tiền v&agrave;o t&agrave;i khoản của m&igrave;nh.<br />\r\n<br />\r\n<strong>Beptot.vn </strong> c&oacute; c&aacute;c t&agrave;i khoản tại</p>\r\n\r\n<p>NG&Acirc;N H&Agrave;NG MB BANK<br />\r\n-T&ecirc;n chủ TK: Nguyễn Đức Trường<br />\r\n-Số TK: 0989 883 888888<br />\r\n-Chi nh&aacute;nh: H&agrave; Nội</p>\r\n\r\n<p>NG&Acirc;N H&Agrave;NG MB BANK<br />\r\n-T&ecirc;n chủ TK: Nguyễn Đức Trường<br />\r\n-Số TK: 0912 886 883<br />\r\n-Chi nh&aacute;nh: H&agrave; Nội</p>\r\n\r\n<p>NG&Acirc;N H&Agrave;NG TECHCOM BANK<br />\r\n- T&ecirc;n chủ TK: Nguyễn Đức Trường<br />\r\n- Số TK: 19027501510013<br />\r\n- Chi nh&aacute;nh: H&agrave; Nội<br />\r\n<br />\r\nNG&Acirc;N H&Agrave;NG VIETTIN BANK<br />\r\n- T&ecirc;n chủ TK: Nguyễn Đức Trường<br />\r\n- Số TK: 104000744394<br />\r\n-Chi nh&aacute;nh: H&agrave; Nội</p>\r\n</div>', 1, 1, 1, '2022-01-15 20:55:46', '2022-01-16 09:17:29');
