INSERT INTO `products` VALUES (1, 'TOMMY HILFIGER 44 mm Nam 1791785', 1, 1, 1, '2022-01-16 15:50:16', '2022-04-05 19:05:15', 600000, 16, NULL, '<div><strong>The High Efficiency 1-Inch Water Softener is designed to provide:</strong>\r\n<ul>\r\n	<li>A smart brine tank automatically monitors salt levels and tells you how many days of salt are remaining. Plus, an easy-to-read display provides system alerts and lets you know your softener is working.</li>\r\n	<li><strong>Convenience</strong>The automatic bypass valve provides the convenience of skipping the water softener or the remote display</li>\r\n	<li><strong>Reliability</strong>A specialized, non-corrosive valve provides more reliability than rotary valve systems. Culligan also offers a high-impact Quadra Hull<sup>®</sup> Tank designed for outdoor use with a four-layer design that resists UV rays, rust, and corrosion.</li>\r\n	<li><strong>Worry-Free Maintenance</strong>An automatic Service Notification to your local Culligan Water Expert takes the hassle and guesswork out of maintenance.</li>\r\n</ul>\r\n</div>', '<p>The Culligan High Efficiency Water Softener brings you better, softer water and can help prolong the lifespan and efficiency of your appliances, heating and plumbing systems.</p>\r\n\r\n<p>The HE Softener features Aqua-Sensors® and smart meter components and automatically adjusts to changes in your home’s water conditions. It only regenerates when needed, and gives you the chance to control and customize water softness throughout your house.</p>', 'tommy-hilfiger-44-mm-nam-1791785', 'Sản phẩm này của hãng đồng hồ Rossini, hãng \r\nđồng hồ với những sản phẩm có mức giá hợp lí nhưng vẫn đảm\r\n bảo được chất lượng cũng như sự đa dạng về thiết kế, mẫu mã, tính năng phù hợp với đại đa số nhu cầu của người dùng.', 5, 4, NULL, NULL, 'bep-ga-haha', 0, 1, 2);
